
let poly = ''
// let pol = 'dabAcCaCBAcCcaDA'

function react(two) {
  // console.log('check ',two.charCodeAt(0), two.charCodeAt(1))
  if (two.charCodeAt(0) + 32 == two.charCodeAt(1) || two.charCodeAt(1) + 32 == two.charCodeAt(0)) 
    return ''
  else 
    return two
}

function review(pol, pos) {
  let newPol = '';
  if (pos > 0) {
    newPol = pol.slice(0,pos)
  } else {
    newPol = '';
  }
  newPol =  newPol + react(pol.slice(pos, pos+2));
  if (pos < pol.length-2) {
    newPol = newPol + pol.slice(pos+2)
  }
  return newPol;
}

for (c = 97; c <= 122; c++ ) {
  let code = String.fromCharCode(c)
  var regex = new RegExp(code,'gi');
  let pol = poly.replace(regex, '');

  var walker = 0;
  while (walker < pol.length) {
    newPol = review(pol, walker)
    // console.log(pol.length, walker)
    if (pol.length == newPol.length) {
      walker++
    } else if (walker > 0) {
      walker = walker - 1;
    }
    pol = newPol;
  }
  console.log(code, pol.length)
}
